import React from "react";

function ArticleLists(props){
    const arr = props.newArr;
    const articleElement = arr.map((element, index) => {
        const style = {"fontWeight" : "bold"}
        return <div key={index}>
            <span style={style}>{element[0]}</span>
            <br/>
            <span>{element[1]}</span>
        </div>
    });

    return <div>{articleElement}</div>
}

export default ArticleLists;
